function Post (){
    const [posts,setPosts] = useState([])

    fetch('https://jsonplaceholder.typicode.com/posts')
    .then((x) => {return x.json()})
    .then((response) => {setPosts(response)})

    return (
        <ul className="list-group">
            <li className="list-group-item">
                <h3></h3>
            </li>
        </ul>
    )
}

export default Post;
